class Solution:
    def makeArrayIncreasing(self, arr1: List[int], arr2: List[int]) -> int:
        INF = float('inf')
        A, B = arr1, list(sorted(set(arr2)))
        N, M = len(A), len(B)

        dp = [[INF for _ in range(M+1)] for _ in range(N)]

        dp[0][0] = A[0]
        for i in range(1, M+1):
            dp[0][i] = min(dp[0][i-1], B[i-1])
        for i in range(1, N):
            if A[i] <= A[i-1]:
                break
            dp[i][0] = A[i]

        for ia in range(1, N):
            for bl in range(1, min(ia+1, M)+1):
                if dp[ia-1][bl] < A[ia]:
                    dp[ia][bl] = A[ia]
                bi = bisect.bisect_right(B, dp[ia-1][bl-1])
                if bi < M:
                    dp[ia][bl] = min(dp[ia][bl], B[bi])

                if dp[N-1][bl] < INF:
                    return bl

        return -1


    def makeArrayIncreasing2(self, arr1: List[int], arr2: List[int]) -> int:

        a1, a2 = arr1, list(sorted(set(arr2)))
        MAXN = 10000
        N, M = len(arr1), len(a2)
        dp = [[[MAXN for _ in range(2)] for _ in range(M+1)] for _ in range(N)]
        dp[0][0][0] = 0
        for i in range(1, N):
            if a1[i] <= a1[i-1]:
                break
            dp[i][0][0] = 0

        for i in range(1, M+1):
            dp[0][i][0] = 0
            dp[0][i][1] = 1

        for j in range(1, M + 1):
            for i in range(1, N):
                dp[i][j][0] = dp[i][j-1][0]
                if a1[i] > a1[i-1]:
                    dp[i][j][0] = min(dp[i][j][0], dp[i-1][j][0])
                if a1[i] > a2[j-1]:
                    dp[i][j][0] = min(dp[i][j][0], dp[i-1][j][1])
                if a2[j-1] > a1[i-1]:
                    dp[i][j][1] = min(dp[i][j][1], dp[i-1][j][0] + 1)
                dp[i][j][1] = min(dp[i][j][1], dp[i-1][j-1][1] + 1)

        ans = min([min(dp[N-1][i]) for i in range(M+1)])
        return ans if ans < MAXN else -1


